	private Matrix inputWeight, layerOne, layerTwo, biasOne, biasTwo, biasInput;

	public CharacterRecognizer(){
		initializeBiases();
		initializeWeights();
	}
	
	public static String arrayToString(Matrix in){
		StringBuffer buffer = new StringBuffer();
		for(int i = 0; i < in.getHeight(); i++) {
			for(int j = 0; j < in.getWidth(); j++) {
				buffer.append(in.get(i, j));
			}
		}
		return buffer.toString() + "\n";
	}

	public int whichCharacter(int[][] input) {
		double[] newChar = new double[input.length * input[0].length];

		int index = 0, width = input[0].length;
		for(int i = 0; i < input.length; i++) {
			index = i * width;
			for(int j = 0; j < width; j++) {
				newChar[index + j] = (input[i][j] * 2) - 1;
			}
		}

		Matrix in = new Matrix(newChar, false);

		Matrix first = Matrix.multiplyLogsigWithBias(inputWeight, in, biasInput);
		Matrix second = Matrix.multiplyLogsigWithBias(layerOne, first, biasOne);
		Matrix out = Matrix.multiplyAddBias(layerTwo, second, biasTwo);

		double temp = 0, maxVal = -10;
		index = 0;
		for(int i = 0; i < out.getHeight(); i++) {
			for(int j = 0; j < out.getWidth(); j++) {
				temp = (out.get(i, j)+1)/2.0;
				if(temp > maxVal) {
					maxVal = temp;
					index = i;
				}
			}
		}
		
		return index;
	}
